import React, { useId } from 'react';
import { useNavigate } from 'react-router-dom';

const User = () => {

    let navigate = useNavigate()

    const marcel = (userId) => {
        console.log('click')
        navigate("../edit/"+ userId)

    }

    return (
        <div className='user'>
            User liste
            <button onClick={() => marcel(4)}>User 4</button>
        </div>
    );
};

export default User;
